The Impact & Inspire limited edition collaboration with the @silverfoxsquad has been an amazing process to be a part of, and we’re thrilled to take the gloves off a bit and get BOLD.

Beautiful contrasts, premium quality materials, and a partnership that values excellence and growth in character development as much as in product development! 

